import React, { useState, useEffect } from "react";
import useTable from "../utils/useTable";
import { useApolloClient } from "@apollo/react-hooks";
import {
  Paper,
  Typography,
  TableBody,
  TableRow,
  TableCell,
  Grid,
} from "@material-ui/core";
import Popup from "../utils/Popup";
import Button from "@material-ui/core/Button";
import { ErrorMessage, Formik, Form, Field } from "formik";
import { TextField } from "material-ui-formik-components/TextField";

import { getAllRanksQuery } from "../queries&Mutations&Functions/Queries";

const headCells = [
  { id: "rankName", label: "Libelle Poste" },
  { id: "rankCode", label: "Code Poste" },
  { id: "id", label: "ID" },
];

const NewRankList = () => {
  const client = useApolloClient();
  const [ranks, setRanks] = useState([]);
  const {
    TblContainer,
    TblHead,
    TblPagination,
    recordsAfterPagingAndSorting,
  } = useTable(ranks, headCells);

  const loadRanksData = async () => {
    const { error, data } = await client.query({
      query: getAllRanksQuery,
    });
    const { ranks } = { ...data };
    console.log(ranks);

    setRanks(ranks);
  };

  useEffect(() => {
    loadRanksData();

    console.log(ranks);
  }, []);

  return (
    <Formik>
      {({ isSubmitting }) => {
        return (
          <Paper>
            <TblContainer>
              <Toolbar>
                <Field
                  component={TextField}
                  autocomplete="off"
                  name=""
                  type="text"
                  label="Nom DÃ©partement"
                  fullWidth
                  variant="outlined"
                  disabled={isSubmitting || loading}
                  helpertext={<ErrorMessage name="divName" />}
                />
                <Button onClick={submitForm}>AddNew</Button>
              </Toolbar>
              <TblHead />
              <TableBody>
                {recordsAfterPagingAndSorting().map((item) => (
                  <TableRow key={item.id}>
                    <TableCell>{item.rankName}</TableCell>
                    <TableCell>{item.rankCode}</TableCell>
                    <TableCell>{item.id}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </TblContainer>
            <TblPagination />
          </Paper>
        );
      }}
    </Formik>
  );
};
export default NewRankList;
